// ==UserScript==
// @author       Magnum357 - edited by nht.ctn
// @name         AniDB External Link Adder
// @namespace    https://github.com/magnum357i/MyAnimeList-External-Link-Adder
// @version      1.0
// @description  Adds an external link in the end of the title
// @icon         data:image/png;base64,

// @match        *://anidb.net/perl-bin/*
// @match        *://anidb.net/anime/*

// @run-at       document-end

// @downloadURL https://update.greasyfork.org/scripts/409853/AniDB%20External%20Link%20Adder.user.js
// @updateURL https://update.greasyfork.org/scripts/409853/AniDB%20External%20Link%20Adder.meta.js
// ==/UserScript==
(function() {

	'use strict';

	var sites =
	[
        { name: 'MAL',            group: '2', status: 'open',   url: 'https://myanimelist.net/anime/%malid%',                                   icon: 'data:image/png;base64,'},
        { name: 'Nyaa',           group: '1', status: 'open',   url: 'https://nyaa.si/?&q=%title%',                                             icon: 'data:image/png;base64,' },
        { name: 'AnimeTosho',     group: '1', status: 'open',   url: 'https://animetosho.org/series/%anidbid%',                                 icon: 'data:image/png;base64,' },
		{ name: 'AniDex',		  group: '1', status: 'open',   url: 'https://anidex.info/?q=%title%',				            				icon: 'data:image/png;base64,' },
        { name: 'AnimeBytes',     group: '1', status: 'open',   url: 'https://animebytes.tv/torrents.php?searchstr=%title%&force_default=1',    icon: 'data:image/png;base64,' },
        { name: 'Youtube',        group: '2', status: 'open',   url: 'https://www.youtube.com/results?search_query=%title%trailer',             icon: 'data:image/png;base64,'},
        { name: 'IMDB_Google',    group: '2', status: 'open',   url: 'https://www.google.com.tr/search?q=%title%+imdb',                         icon: 'data:image/png;base64,'},
        { name: 'PlanetDP',       group: '2', status: 'open',   url: 'https://www.planetdp.org/movie/search?title=%title%',                     icon: 'data:image/png;base64,' },
//        { name: 'Türkçe Altyazı', group: '2', status: 'open',   url: 'http://www.turkcealtyazi.org/find.php?cat=sub&find=%title%',              icon: 'data:image/x-icon;base64,%3D%3D'},
//        { name: 'Subscene',       group: '2', status: 'open',   url: 'http://subscene.com/subtitles/title?q=%title%',                           icon: 'data:image/gif;base64,' },
		{ name: 'TürkAnime',      group: '2', status: 'open',   url: 'https://www.turkanime.tv/?q=%title%',                                     icon: 'data:image/png;base64,'},

        { name: 'Sample',         group: '2', status: 'close',   url: '%title%',             icon: '' },
    ];

	var pageUrl = window.location.href;
	var anidbId = pageUrl.match(/(anidb\.net\/anime\/|\?show=anime\&aid=)(\d+)/)[2];
	var elTitle = document.querySelector( 'h1[class="anime"]');

	var title = elTitle.textContent.trim().substr(7);
    if (title.indexOf("(") >= 0) { title = title.substr(0, title.indexOf("(")-1);}

	title = title
		.replace( "(", "" )
		.replace( ")", "" )
		.replace( "-", " " )
        .replace("&amp;","&") //replace & with code
        .replace("&nbsp;","") //delete nobreak space
        .replace(/[\/\\#+()$~%'"*?<>{}]/g, "") //remove bad chars
    ;

    //if it exist, get the mal id. If does not exist but needed, replace url
    var malLink = document.querySelector( 'a[href^="https://myanimelist.net"]' );
    if (malLink) {var malId = malLink.href; malId = malId.substr(30);}
    else { var g = getFirstItem(sites, 'name', 'MAL'); if (g != null) { sites[g].url = 'https://myanimelist.net/anime.php?q=%title%';}}


	function html( $groupId, $left )
	{
		var h = '';

		for( var i = 0, len = sites.length; i < len; i++ )
		{
			var s = sites[i];

            if ( s.status == 'open' && s.group == $groupId )
            {
                h += '<li style="padding: 0 3px;"><a style="height: 20px; line-height: 20px; z-index: 10; display: inline-flex; " href="' + url( s.url ) + '" target="_blank"><img style="width: 16px; height: 16px;" src="' + s.icon + '" title="' + s.name + '"><\/a></li>';
            }
		}

		return '<div style="display: inline; background: #cfd1d4; padding: 1px 2px; margin-left: ' + $left + 'px; border: 1px solid #bebebe; border-radius: 3px;"><ul style="margin: 0; list-style-type: none; display: inline-flex; padding: 0; vertical-align: middle;">' + h + '</ul></div>';
	}

	function url( site ) {
        site = site.replace( /%title%/, encodeURIComponent( title ) );
        site = site.replace( /%malid%/, malId );
		site = site.replace( /%anidbid%/, anidbId );

        return site;
    }

    function getFirstItem(input, key, value) {
        for(var i = 0; i < input.length; i++) {
            var obj = input[i];
            if(obj[key] == value) {return i;}
        } return null;
    }

	elTitle.innerHTML += html( 1, 10 ) + html( 2, 10 );
	

})();